import CartIcon from './shopping-cart.svg'
import './App.css';
const Cart = ()=>{
    return (
    <div className="header">
        <p>T-shirt Store</p>
        <span>
            <img src={CartIcon} alt="cart" height="30" width="30"/>
            <span className="count">0</span>
        </span>
    </div>)
}
export default Cart;
